import React, { useState, useEffect, Component } from "react";
import "../AccountsAsset/dash.css";
import { Route, Switch, useHistory, Redirect, NavLink } from "react-router-dom";
import Sidebar from "../Component/Sidebar";
import Stock from "../Component/Stock";
import UserProfile from "../Component/UserProfile";
import SubSidebar from "../Component/SubSidebar";

import Account from "../Component/Account";
import Notification from "../Component/Notification";
import Orders from "../Component/Orders";
import TradingViewWidget, { Themes } from "react-tradingview-widget";
import { NavBarWithRouter } from "../Component/NavBar/NavBar";
import card from "../AccountsAsset/images/card.png";
import watch from "../AccountsAsset/images/stopwatch.webp";
import { message } from "antd";
let userID = localStorage.getItem("user");

class Dashboard extends Component {
  constructor(props) {
    super(props);
    this.state = {
      verShow: false,
      fx: ["EURUSD", "USDGBP", "USDJPY"],
      fxPrice: [],
      iex: [],
      crypto: [],
      cum: [],
      hideIbox: true,
      currentItem: [],
      num: 1,
      addCurrentItemC: [],
      addCurrentItemFx: [],
      addCurrentItemCum: [],
      addCurrentItemIex: [],
      fillArr: [],
      nullF: "",
      setView: [],
      setViewM: [],
      orderIsh: [],
      unitP: "",
      user: this.props.user ,
      redirect: "/",
      data: {}, 
      deposit: {},
      orders: [],
      history: [],
      disA1: true,
      disA2: true,
      btcP: [],
      market: false,
      board: true,
      port: false,
      manager: false,
      levIsh: false,
      admin: false,
      VView: false,
      selectedFiles: [],
      fileUp: {},
      forexShow: false,
      verifyS: this.props.user.user ? this.props.user.user.user.verify : false,
      isTrading:this.props.user.user ? this.props.user.user.user.isTrading: false,
      autoTrade:this.props.user.user ? this.props.user.user.user.autoTrade: false,
      activeS: "BTCUSD",
      all: true,
      allC: false,
      allF: false,
      allCum: false,
      allS: false,
      totalUp: 0,
      gasP: [],
      aaplP: [],
      tslaP: [],
      ethP: [],
      ver1: true,
      ver2: false,
      ver3: false,
      ver4: false,
      ver5: false,
      DocumentFile: "",
      name: "",
      address: "",
      phoneNumber:"",
      doc: "",
      docProof:"",
      docPass:"",
      isTrading1:this.props.user.user ? this.props.user.user.user.isTrading: false,

    };
    this.myRef3 = this.props.user.user ? React.createRef() : "";
    this.textInput = this.props.user.user ? React.createRef() : "";
    this.myRef4 = this.props.user.user ? React.createRef() : "";
  }
  token = "pk_135c1daf1b8d4130b9318fd5e8ab0e5e";
  handleTrading=(e)=>{

    console.log('isss',this.state.isTrading1)

    this.setState({
      isTrading1: !this.state.isTrading1
    })


    fetch(
      `https://bridgegatebackend.herokuapp.com/api/profile/isTrading`,
      {
        mode: "cors",
        method: "PUT",
        headers: {
          Accept: "application/json",
          "Content-Type": "application/json",
        },
        body: JSON.stringify({id:this.state.user.user.user._id, isTrading:e.target.checked}),
      }
    )
      .then(function (res) {
      if(res){
      console.log(res)
      }
      })

  }
  componentDidMount() {
    (async () => {
      let response = await fetch(
        `https://bridgegatebackend.herokuapp.com/api/trade/${
          this.state.user.user ? this.state.user.user.user._id : ""
        }`
      );
      let data = await response.json();
      this.setState({
        orders: data,
      });
      let a = { orders: data };

      localStorage.setItem("orders", JSON.stringify(a));
    })();

    (async () => {
      let response = await fetch(
        `https://bridgegatebackend.herokuapp.com/api/trade/his/${
          this.state.user.user ? this.state.user.user.user._id : ""
        }`
      );
      let data = await response.json();
      this.setState({
        history: data,
      });
      let a = { history: data };

      localStorage.setItem("historys", JSON.stringify(a));
    })();

    (async () => {
      let response = await fetch(
        `https://bridgegatebackend.herokuapp.com/api/trade/user/${
          this.state.user.user ? this.state.user.user.user._id : ""
        }`
      );
      let user = await response.json();

      this.setState({
        user: user,
      });
    })();

    if (this.props.user.user) {
      const script3 = document.createElement("script");
      script3.src = "https://cdn.jsdelivr.net/gh/codabae/hostjs/dashUPPER15.js";
      script3.async = true;

      this.myRef3.current.appendChild(script3);
    }

    // GET Request.
    fetch(
      `https://cloud.iexapis.com/stable/fx/latest?symbols=${this.state.fx}&token=${this.token}`
    )
      // Handle success
      .then((response) => response.json()) // convert to json
      .then((json) => {
        this.setState({ fxPrice: json });
      }); //print data to console

    //crytp
    fetch(
      `https://cloud.iexapis.com/stable/crypto/BTCUSD/price?token=${this.token}`
    )
      // Handle success
      .then((response) => response.json()) // convert to json
      .then((json) => {
        this.setState({ crypto: [...this.state.crypto, ...[json]] });
        this.setState({ bitP: json });

        this.setState({
          orderIsh: json.price,

          setView: { ...json, tag: "Crypto" },
          setViewM: json.price,
        });
      }); //print data to console
    // Catch errors

    fetch(
      `https://cloud.iexapis.com/stable/crypto/ETHUSD/price?token=${this.token}`
    )
      // Handle success
      .then((response) => response.json()) // convert to json
      .then((json) => {
        this.setState({ crypto: [...this.state.crypto, ...[json]] });
        this.setState({ ethP: json });
      }); //print data to console
    // Catch errors

    fetch(
      `https://cloud.iexapis.com/stable/crypto/LTCUSD/price?token=${this.token}`
    )
      // Handle success
      .then((response) => response.json()) // convert to json
      .then((json) => {
        this.setState({ crypto: [...this.state.crypto, ...[json]] });
      }); //print data to console
    // Catch errors

    //stock

    fetch(
      `https://cloud.iexapis.com/stable/stock/AAPL/price?token=${this.token}`
    )
      // Handle success
      .then((response) => response.json()) // convert to json
      .then((json) => {
        this.setState({
          iex: [...this.state.iex, ...[{ price: json, symbol: "AAPL" }]],
        });
        this.setState({ aaplP: { price: json, symbol: "AAPL" } });
      }); //print data to console
    // Catch errors

    fetch(
      `https://cloud.iexapis.com/stable/stock/TSLA/price?token=${this.token}`
    )
      // Handle success
      .then((response) => response.json()) // convert to json
      .then((json) => {
        this.setState({
          iex: [...this.state.iex, ...[{ price: json, symbol: "TSLA" }]],
        });
        this.setState({ tslaP: { price: json, symbol: "TSLA" } });
      }); //print data to console
    // Catch errors

    fetch(
      `https://cloud.iexapis.com/stable/stock/GOOGL/price?token=${this.token}`
    )
      // Handle success
      .then((response) => response.json()) // convert to json
      .then((json) => {
        this.setState({
          iex: [...this.state.iex, ...[{ price: json, symbol: "GOOGL" }]],
        });
      }); //print data to console
    // Catch errors

    fetch(`https://cloud.iexapis.com/stable/stock/FB/price?token=${this.token}`)
      // Handle success
      .then((response) => response.json()) // convert to json
      .then((json) => {
        this.setState({
          iex: [...this.state.iex, ...[{ price: json, symbol: "FB" }]],
        });
      }); //print data to console
    // Catch errors

    fetch(
      `https://cloud.iexapis.com/stable/stock/MSFT/price?token=${this.token}`
    )
      // Handle success
      .then((response) => response.json()) // convert to json
      .then((json) => {
        this.setState({
          iex: [...this.state.iex, ...[{ price: json, symbol: "MSFT" }]],
        });
      }); //print data to console
    // Catch errors

    //commdity

    fetch(
      `https://cloud.iexapis.com/stable/data-points/market/DCOILWTICO?token=${this.token}`
    )
      // Handle success
      .then((response) => response.json()) // convert to json
      .then((json) => {
        this.setState({
          cum: [...this.state.cum, ...[{ price: json, symbol: "Propane" }]],
        });
      }); //print data to console
    // Catch errors

    fetch(
      `https://cloud.iexapis.com/stable/data-points/market/DHHNGSP?token=${this.token}`
    )
      // Handle success
      .then((response) => response.json()) // convert to json
      .then((json) => {
        this.setState({
          cum: [...this.state.cum, ...[{ price: json, symbol: "Diesel" }]],
        });
      }); //print data to console
    // Catch errors

    fetch(
      `https://cloud.iexapis.com/stable/data-points/market/DCOILWTICO?token=${this.token}`
    )
      // Handle success
      .then((response) => response.json()) // convert to json
      .then((json) => {
        this.setState({
          cum: [...this.state.cum, ...[{ price: json, symbol: "Jet Fuel" }]],
        });
      }); //print data to console
